Live At Donington is the DVD recording of the AC/DC show at Donington Park on 17 August 1991, and it was the band's third &quot;Monsters Of Rock&quot; festival. The show was a 2 hour performance that included real cannons, the Hells Bell, an inflatable Rosie and an inflatable Angus. It was filmed in 35 mm Panavision and had 26 cameras that included one situated inside a helicopter. The DVD includes special features such as stereo and 5.1 surround sound, Iso-cam versions of certain songs for different band members, and audio commentary from Angus and Malcolm Young.
